import React from 'react';
import { NavLink  } from 'react-router-dom';

const Menu = () => {
  return (
    <>
    <div className='menu'>
       <NavLink exact activeClassName='active-class' to='/'>About</NavLink>
       <NavLink exact activeClassName='active-class' to='/User/Malaika/Narmeen'>User</NavLink>
       <NavLink exact activeClassName='active-class' to='/ContactUs'>ContactUs</NavLink>
       <NavLink exact activeClassName='active-class' to='/Services'>Services</NavLink>
       <NavLink exact activeClassName='active-class' to='/Search'>Search</NavLink>

       </div>
       
      
    </>
  );
};

export default Menu;
